    false,nt"url": null,nt"notes": "In 1978, cliff-nesting seabirds at Nunivak
    Island were surveyed, and five permanent study plots were delineated for future
    evaluations of population changes (Ritchie 1978). In 1980 a small island in Duchikthluk
    Bay, which has been an arctic tern nesting colony for years, was surveyed for terns
    and nesting ducks for the purpose of including this area as an additional permanent
    study plot. In 1982, a very late year phenologically on the Yukon Delta National
    Wildlife Refuge, the first censuses were conducted of the permanent study plots
    since their establishment. This report summarizes our findings, compares them with
    previous counts, and provides recommendations for future surveys.",nt"owner_org":
